import React, { useEffect, useState } from "react";

const ShowTbale = () => {
  const [userData, setuserData] = useState([]);

  useEffect(() => {
    const lenData = JSON.parse(localStorage.getItem("register"));
    console.log(lenData);
    setuserData(lenData);
  }, []);
  return (
    <>
      <h1>ShowTbal</h1>
      <table className="table table-dark">
        <thead>
          <tr>
            <th scope="col">ID</th>
            <th scope="col">NAME</th>
            <th scope="col">EMAIL</th>
            <th scope="col">AGE</th>
            <th scope="col">MOBILE</th>
            <th scope="col">GENDER</th>
            <th scope="col">CITY</th>
          </tr>
        </thead>
        <tbody>
          {userData && userData? userData.map((ele) => {
            return (
              <>
                <tr>
                  <td>{ele.id}</td>
                  <td>{ele.name}</td>
                  <td>{ele.email}</td>
                  <td>{ele.age}</td>
                  <td>{ele.mobile}</td>
                  <td>{ele.gender}</td>
                  <td>{ele.city}</td>
                </tr>
              </>
            );
          }):""}
        </tbody>
      </table>
    </>
  );
};

export default ShowTbale;
